import React, {Component} from 'react';
import './Slider.css';
import Img from "../../image/ocre.jpg"
import verteau from "../../image/verteau.jpg"
import bleu from "../../image/bleu.jpg"



class Slider  extends Component {


    render(){
        const images= [
            <img className="ContainerImg" src={Img} alt="logo"></img>,
            <img className="ContainerImg" src={verteau} alt="logo"></img>,
            <img className="ContainerImg" src={bleu} alt="logo"></img>
                ]
        return (
        <div className="AppSlider">
        <div className="container">
        <img className="ImgSelected" src= "" alt="SelectedImg"></img>
        <div className="imgContainer">
            images[0]
        </div>
        </div>
        </div>

        )};
}


export default Slider
